import { Component } from "react"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUser,faFile,faPencilAlt,faCamera,faAngleRight} from '@fortawesome/fontawesome-free-solid'
import Texteditor from "./Texteditor"



class Resume extends Component{
    componentDidMount(){
let resume = document.getElementById("Resume");
resume.onclick = function(){
    document.querySelector("#Resume-editor").classList.toggle("show")
}
    }
 
render(){



    return(   
        <div style={{justifyContent:"center",display:"flex",marginTop:"5em"}}>
       <div className="col-sm-10 resume-container" >

       <span><FontAwesomeIcon icon={faUser} /></span> 
       <h5 id="Resume">Resume Opjective</h5>

       <div >
        <div style={{cursor:"text",border:"1px solid rgba(229,229,231,0.75)",padding:"1em"}} id="Resume-editor" className="Resume-editor">

            <h6>Description</h6>
            <Texteditor/>
        </div>
       </div>
       </div>
      </div>
      )
        
    
}
}


export default Resume
